import React from 'react';
import { Link } from 'react-router-dom';
import '..styles/';

const Home = () => {
  return (
    <div>
      <h1>Welcome to OptiHome</h1>
      <p>Your smart home automation system.</p>
      <div>
        <Link to="/login">
          <button>Login</button>
        </Link>
        <Link to="/signup">
          <button>Signup</button>
        </Link>
      </div>
    </div>
  );
};

export default Home;
